import React from 'react';

const DataItemComponent = ({ item }) => {
    return (
        <li>
          <h3>{item.name}</h3>
          <p>Description: {item.weather[0].description}</p>
          <p>Temperature: {item.main.temp} °C</p>
          <p>Humidity: {item.main.humidity}%</p>
        </li>
    );
};

export default DataItemComponent;
